var fileJSON=[{"path":"/home/joerock/Documents/TFM/Quartus_Sim-Em/Squeezenet/device/v1.3/conv3x3/conv3x3_NDRange.cl", "name":"conv3x3_NDRange.cl", "has_active_debug_locs":false, "absName":"/home/joerock/Documents/TFM/Quartus_Sim-Em/Squeezenet/device/v1.3/conv3x3/conv3x3_NDRange.cl", "content":"//3x3 convolution layer\012//output one feature map per kernel\012__kernel void conv2d3x3(\012	const int input_channels, const int input_size,\012	const int pad, const int stride,\012	const int start_channel, //start_channel is for 1x1 feature map in fire layer\012	const int output_size,\012	__global const float* restrict input_im,\012	__global const float* restrict filter_weight,\012	__global const float* restrict filter_bias,\012	__global float *restrict output_im\012	)\012{\012	int filter_index = get_global_id(0); //get output channel index\012	int i =  get_global_id(1);\012\012	filter_weight += filter_index * input_channels * 9;\012	float bias = filter_bias[filter_index];\012	output_im += (start_channel + filter_index) * output_size * output_size;\012	\012	//loop over output feature map\012	//for(int i = 0; i < output_size; i++)\012	{\012		for(int j = 0; j < output_size; j++)\012		{\012			//compute one element in the output feature map\012			float tmp = bias;\012			\012			//compute dot product of 2 input_channels x 3 x 3 matrix\012			for(int k = 0; k < input_channels; k++)\012			{\012				#pragma unroll\012				for(int l = 0; l < 3; l++)\012				{\012					int h = i * stride + l - pad;\012					for(int m = 0; m < 3; m++)\012					{\012						int w = j * stride + m - pad;\012						if((h >= 0) && (h < input_size) && (w >= 0) && (w < input_size))\012						{\012							tmp += input_im[k * input_size * input_size + h * input_size + w]\\\012                               * filter_weight[9 * k + 3 * l + m];\012						}\012					}\012				}\012			}\012\012			//add relu activation after conv\012			output_im[i * output_size + j] = (tmp > 0.0) ? tmp : 0.0;\012		}\012	}\012}\012"}];
